import React from "react";
import ReactDOM from "react-dom";
import * as que from "./App";
ReactDOM.render(<>
<ol>
<li>shubham</li>
<li>{que.default}</li> 
<li>{que.favp}</li>
<li>{que.my()}</li>
<li>{que.myy()}</li>
<li>{que.mys()}</li>
</ol>
</>,
document.getElementById('root')
	);
